import "./navbar.css";

const Navbar = props => {
  return (
    <ul className="nav nav-tabs">
      <li className="nav-item">
        <a href="/pages/homes">Home</a>
      </li>
      <li className="nav-item">
        <a href="/pages/bands">Bands</a>
      </li>
      <li className="nav-item">
        <a href="/pages/musicians">Musicians</a>
      </li>
    </ul>
  );
};
export default Navbar;
